import React from "react";
import "./Support.css";
import Ticket from "../Ticket/Ticket";

const Message =(props) => {
    return <div className="message">{props.messagetext}</div>
}
const Support = (props) =>{
    return (
        <div className="Support">
         <div className="support-wrapper">
            <div className="tickets">
                <Ticket ticketid="1" ticketheme="Не пришёл товар" />
                <Ticket ticketid="2" ticketheme="Долго грузится карточка товара" />
                <Ticket ticketid="3" ticketheme="Не нравится мне что то ваш сайт" />
                <Ticket ticketid="4" ticketheme="Купил паленый товар,верните денежку" />
                <Ticket ticketid="5" ticketheme="Ты чорт" />
                <Ticket ticketid="6" ticketheme="Можно бесплатно?" />
                <Ticket ticketid="7" ticketheme="Как вернуть товар?" />
                <Ticket ticketid="8" ticketheme="Я не хочу больше этой хуйней заниматься" />        
            </div>
            <div className="chat-container">
            <div className="messages">
                <Message messagetext="Привет"/>
                <Message messagetext="Как дела"/>
                <Message messagetext="Норм"/>
                <Message messagetext="Пока"/>
                <Message messagetext="Пока"/>
            </div>
            </div>
         </div>
        </div>
        
    );
}

export default Support;
